import React, { Component } from "react";
import { Row, Col } from "antd";
import Menu from "../components/Menu";
import Logo from "../components/Logo";
import styled from "styled-components";
import Photo1 from "../images/ProfileImage.png";
const Contents = styled(Row).attrs(() => ({ type: "flex", }))`
  margin-top: 100px;
  background-color: #f3f7f820;
  margin-left: auto;
  margin-right: auto;
  width: 1000px;
  height: 100px;
`;

export class Home extends Component {
  render() {
    return (
      <Row type="flex" align="middle" style={{ background: "#0a262e" }}>
        <Col span={24} style={{ textAlign: "center" }}>
          <Logo />
          <Menu />
        </Col>
        <Contents>
          <Col span={8}>
            tag
          </Col>
          <Col span={8}>
            <img src={Photo1} style={{width: "100%", marginTop: "100px"}} alt="Photo1"/>
          </Col>
          <Col span={8}>

          </Col>
        </Contents>
      </Row>
    );
  }
}

export default Home;
